import React from 'react'


const Card = ({name, height, mass, eye_color, birth_year, gender}) => {
    return (
        <div className="dib bg-yellow ma3 pa3 br3 text-shadow: 0 0 3px #FF0000; ">

        <h1>{name}</h1>
        <p>Height: {height}</p>   
        <p>Mass: {mass}</p>   
        <p>Eye Color: {eye_color}</p>   
        <p>Birth Year: {birth_year}</p>   
        <p>Gender: {gender}</p>       
        </div>
    )
};

export default Card
